func TestMaxOperations(t *testing.T) {
	for i, v := range tests {
		t.Log("test: ", i+1)
		moveZeroes(v.nums)
		assert.Equal(t, v.expected, v.nums)
	}
}

func BenchmarkMaxOperations(b *testing.B) {
	funcs := []struct {
		name string
		f    func([]int)
	}{
		{"mine", moveZeroes},
		{"leet-fastest", moveZeroes_leet7ms},
	}

	for _, fun := range funcs {

		b.Run(fun.name, func(b *testing.B) {
			b.ReportAllocs()
			b.ResetTimer()
			for k := 0; k < b.N; k++ {
				fun.f(tests[k%len(tests)].nums)
			}
		})
	}
}
